import React, {useState} from "react"
import {
    Switch,
    Route,
    useRouteMatch
  } from "react-router-dom";
import '../css/main.css';
import Navbar from './MainComponents/Navbar'
import Inventory from './MainComponents/Inventory'
import Account from './MainComponents/Account'
import Order from './MainComponents/Order'
import Business from './MainComponents/Business'

const Main = (props) =>{
    
    let { path, url } = useRouteMatch();

    return(
        <div id="main">
            <Navbar />
            <div className="main-content">
                <Switch>
                    <Route exact path={[path,`${path}/inventory`]} render={<Inventory />} />
                    <Route exact path={[`${path}/order`]} render={<Order />} />
                    <Route exact path={[`${path}/business`]} render={<Business />} />
                    <Route exact path={[`${path}/account`]} render={<Account accountInfo={props.accountInfo}/>} />
                </Switch>
            </div>
        </div>
    )        
}

export default Main;
